import React, { useState } from 'react';
import '../css/homepage.css';
const Homepage = () => {
    return (
        <div className='homepage'>
            <div className='menu'>
                <nav>
                    <ul className='navbar'>
                        <a href="#login">Đăng nhập</a>
                        <a href="#register">Đăng ký</a>
                    </ul>
                </nav>
            </div>
            <div className='content'>
                {}
            </div>
        </div>
    );
};

export default Homepage;
